  state = {
    counters: [
      { id: 1, value: 0 },
      { id: 2, value: 9 },
      { id: 3, value: 11 },
      { id: 4, value: 10 }
    ]
  };
  render() {
    console.log("s", this.props)
    return (
      <div>
        {
          this.state.counters.map(counter =>
            <Counter key={this.state.counters[0]} value={counter.value}>

            </Counter>)
        }
      </div>
    );
  }
}

export default counters;
